window.bookSummaryJSON = "<p><b>I shouldn't have felt this way about her. She's my brother-in-law's first love.</b></p> <p>She was forbidden fruit. Ain't shit ever been forbidden for me. I take what I want, and I want her. I shouldn't have these strong of feelings for a woman I just met.</p> <p>I wanted to lay every man who even thought about looking her wayâ€¦ including my brother-in-law.</p> <p>Erin was mine before she even knew it. Our paths were meant to cross, our futures to intertwine.</p> <p>I don't like liars or thieves, but for Erin, I'd pull that ski mask on and steal her heart, if that's what it takes.</p> <p>He's my first love's brother-in-law. Everything about Capone has told me to stay away from him. He's not good for me. He has the power to make me feel again, and the last time I felt anything for someone, it nearly destroyed me.</p> <p>I should stay away from him, but every part of my body is betraying me. Screaming, yearning, craving his touch, and for him to be close to me.</p> <p>I don't think he would ever need to steal my heart because I would gladly hand it over to him.</p>"; 
